def plot_original_data(coordinates):
    x_coords = [coord[0] for coord in coordinates]
    y_coords = [coord[1] for coord in coordinates]

    plt.scatter(x_coords, y_coords, alpha=0.6)
    plt.title('Random Database Point Distribution')
    plt.xlabel('i')
    plt.ylabel('j')
    plt.grid(True)
    plt.show()


